import React from "react";
import TopNavBar from "./Navbar";
import Videos from "./Videos";
import { Popover, ArrowContainer } from "react-tiny-popover";

class Home extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div>
        <div>
          <TopNavBar />
        </div>
        <div>
          <Videos />
        </div>
      </div>
    );
  }
}

export default Home;
